    class Context {
        -state;
        + Contect(initialState)
        + changeState(state)
        + doThis()
        + doThat()
    }

    class Pacient {
        -habitacio: Habitacio;
        -simptomes: Simptomes;
        -malaltia: Malaltia;
        -estat: Estat;
        +canviarEstat(Estat newEstat) boolean
        +afegirSimptoma(Simptoma) boolean
        +eliminarSimptoma(Simptoma) boolean
        +donarMedicacio(Medicació medicacio) boolean
    }

    class Treballador {
        -especialitat: Especialitat;
        -horari: String;
    }

    class Especialitat {
        -id: int;
        -nom: String;
        -treballador: ArrayList~Treballador~;
    }
    class Simptoma {
        -id: int;
        -nom: String;
    }

    class Medicació {
        -id: int;
        -quantitat: int;
        - nom: String;
    }

    class Habitació {
        -id: int;
        -capacitat: int;
        -panta: int;
    }
    Persona <|-- Pacient
    Persona <|-- Treballador
    Especialitat o-- Treballador
    Treballador -- Pacient : visita
    Pacient o-- Simptoma
    Pacient o-- Medicació
    Pacient o-- Habitació










